import useBaseUrl from '@docusaurus/useBaseUrl';
export const toc = [{
  value: 'Touring the Interface',
  id: 'touring-the-interface',
  children: []
}, {
  value: 'Using Filters to Adjust the Scope of Your Data',
  id: 'using-filters-to-adjust-the-scope-of-your-data',
  children: []
}];

const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`The Insights section of your Sauce Labs app allows you to view your test data from a variety of different perspectives to ensure that you can see both the big picture of your testing effectiveness and the individual slices of test data that help you pinpoint failure causes and fix them.`}</p>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`NOTE:`}</strong>{` Sauce Labs has also published an `}<a parentName="p" {...{
          "href": "https://wiki.saucelabs.com/display/DOCS/Sauce+Insights+Methods"
        }}>{`Insights API`}</a>{` so you can build a custom dashboard with views that are specific to your test strategy.`}</p>
    </blockquote>
    <h2 {...{
      "id": "touring-the-interface"
    }}>{`Touring the Interface`}</h2>
    <p>{`Access the `}<strong parentName="p">{`Insights`}</strong>{` menu from the left-side navigation menu of our web app. From here, you have access to the five primary views of your test data.`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Page`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Test Overview`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Shows a variety of views of the data related to all the tests executed that match the specified filter criteria broken into three focus tabs. The `}<strong parentName="td">{`Overview`}</strong>{` tab shows concatenated pass/fail statistics and platform breakdowns. The `}<strong parentName="td">{`Tests`}</strong>{` tab shows a list of all tests which can be clicked to launch a view of data for just that test. The `}<strong parentName="td">{`Errors`}</strong>{` tab counts the number of instances of each error that occurred across the execution of all tests in the filter. Click any error to see the list of tests in which it occurred.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Test History`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Shows a visual snapshot of the results for a specific test over time. See the `}<a parentName="td" {...{
              "href": "/insights/history"
            }}>{`Test History`}</a>{` page for specific views and capabilities descriptions.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Trends`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Shows graphical visualizations of all tests. Applying filters to this view makes it easy to compare test outcomes for different variables, such as device browser version. See the `}<a parentName="td" {...{
              "href": "/insights/trends"
            }}>{`Trends`}</a>{` page for detailed documentation.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`VM Concurrency`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Shows how many VM instances are in use simultaneously at any given time. See `}<a parentName="td" {...{
              "href": "https://wiki.saucelabs.com/display/DOCS/Understanding+Concurrency+Limits+and+Team+Accounts"
            }}>{`Team Concurrency`}</a>{` for information about how concurrency is allocated.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Failure Analysis`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Exposes the results of the Sauce Labs machine learning algorithms that comb through every command run in every test and each error thrown in those tests to determine emerging patterns. See the `}<a parentName="td" {...{
              "href": "/insights/failure-analysis"
            }}>{`Failure Analysis`}</a>{` page for detailed documentation.`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "using-filters-to-adjust-the-scope-of-your-data"
    }}>{`Using Filters to Adjust the Scope of Your Data`}</h2>
    <p>{`At the top of each page in the `}<strong parentName="p">{`Insights`}</strong>{` interface is a set of properties by which you can filter the data shown on that page. As you specify values for each property, the setting is shown below the filters bar and the data on the page refreshes to reflect the applied filters.`}</p>
    <img src={useBaseUrl('img/insights/ins-filters.png')} alt="Applied Filters" width="750" />
    <p>{`The following table describes each of the filters available for customizing your test insights data.`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Filter`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Owner`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Show data for tests owned by one or more individuals, teams, or your whole organization. You will see different options here depending on your access and role within your organization or team.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Build`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Show data for tests that are included in specified builds, or groups of related tests.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`OS`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Show data for tests run on the specified operating systems. The menu lists each OS version separately.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Browser`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Show data for tests run on the specified browsers. The menu lists each browser version separately so you can compare versions of the same browser.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Tag`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Show data for tests or builds that are categorized using the specified tag(s).The `}<strong parentName="td">{`Tag`}</strong>{` filter is not available for all sections of the Insights interface.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Time Period`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Show data for tests that executed within the specified time period. In the selection modal, choose the `}<strong parentName="td">{`Relative`}</strong>{` tab to set a duration up through the current day and time. Choose the `}<strong parentName="td">{`Absolute`}</strong>{` tab to set a specific window within start and end dates.`}<br /><br /><strong parentName="td">{`NOTE:`}</strong>{` Times and dates are in the local time of the logged in user. If you are not seeing data you expect in that duration, consider whether the test was executed in a different time zone.`}</td>
        </tr>
      </tbody>
    </table>
    <p>{`Check out the individual sections of the Insights feature documentation for use cases illustrating how filtering your data view can help you pinpoint errors or inefficiencies in your tests so you can be confident that your app is functioning optimally.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
